"use strict";{const content='\n<webui-input-range name="autosignout" data-subscribe="session-autosignout:setValue" data-trigger="session-autosignout" label="Inactivity Signout" title="Minutes of inactivity to auto-sign-out" min="5" step="5" max="2880" onrender="webui.displayMinutes"></webui-input-range>\n';webui.define("app-account-settings",{content:!0,watchVisibility:!1,isInput:!1,preload:"",flags:[],attr:["height","max-height"],attrChanged(property,value){const t=this;switch(property){case"height":t.style.height=webui.pxIfNumber(value);break;case"maxHeight":t.style.maxHeight=webui.pxIfNumber(value)}},connected(){this.setupComponent()},setupComponent(){this.innerHTML=content;const autoSignout=this.querySelector('[name="autosignout"]');let cookieAge=webui.getData("session-autosignout")||30,latestUpdate=cookieAge;autoSignout.addEventListener("change",(_=>{let value=autoSignout.value;latestUpdate=value,value!==cookieAge&&setTimeout((()=>{value===latestUpdate&&(cookieAge=webui.getData("session-autosignout"),cookieAge===value&&webui.fetchApi("cookie/age"))}),600)}))}})}